import React from 'react';
import { PacmanLoader } from 'react-spinners';

const LoadingCenter = props => {
    const {classes} = props;

    return (
        <div className="sweet-loading">
            <PacmanLoader
                className={classes.progress}
                //css={override}
                sizeUnit={'px'}
                size={20}
                color={'#36D7B7'}
            />
        </div>
    );
};
export default withStyles(styles)(LoadingCenter);
